import React, { useEffect, useState } from 'react';
import axios from 'axios';

const AdminDashboard = () => {
  const [teachers, setTeachers] = useState([]);
  const [newTeacher, setNewTeacher] = useState({ name: '', email: '', password: '' });

  // Fetch all teachers
  const fetchTeachers = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/teachers');
      setTeachers(res.data);
    } catch (err) {
      alert('Error fetching teachers');
    }
  };

  useEffect(() => {
    fetchTeachers();
  }, []);

  // Add a new teacher
  const handleAddTeacher = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/teachers', newTeacher);
      alert('Teacher added');
      setNewTeacher({ name: '', email: '', password: '' });
      fetchTeachers();
    } catch (err) {
      alert('Error adding teacher');
    }
  };

  // Delete teacher
  const handleDelete = async (id) => {
    if (!window.confirm('Are you sure you want to delete this teacher?')) return;
    try {
      await axios.delete(`http://localhost:5000/api/teachers/${id}`);
      alert('Teacher deleted');
      fetchTeachers();
    } catch (err) {
      alert('Error deleting teacher');
    }
  };

  return (
    <div className="p-8 bg-gray-100 min-h-screen">
      <h1 className="text-3xl font-bold mb-6">Admin Dashboard</h1>

      {/* Add Teacher Form */}
      <form onSubmit={handleAddTeacher} className="bg-white p-6 rounded shadow mb-8 max-w-md">
        <h2 className="text-xl font-semibold mb-4">Add New Teacher</h2>
        <input type="text" placeholder="Name" value={newTeacher.name}
          onChange={(e) => setNewTeacher({ ...newTeacher, name: e.target.value })}
          className="w-full mb-3 px-3 py-2 border rounded" required />
        <input type="email" placeholder="Email" value={newTeacher.email}
          onChange={(e) => setNewTeacher({ ...newTeacher, email: e.target.value })}
          className="w-full mb-3 px-3 py-2 border rounded" required />
        <input type="password" placeholder="Password" value={newTeacher.password}
          onChange={(e) => setNewTeacher({ ...newTeacher, password: e.target.value })}
          className="w-full mb-3 px-3 py-2 border rounded" required />
        <button type="submit" className="bg-green-600 text-white px-4 py-2 rounded w-full">Add Teacher</button>
      </form>

      {/* Teachers List */}
      <div className="bg-white p-6 rounded shadow">
        <h2 className="text-xl font-semibold mb-4">All Teachers</h2>
        {teachers.length === 0 ? (
          <p>No teachers found.</p>
        ) : (
          <table className="w-full table-auto">
            <thead>
              <tr className="bg-gray-200">
                <th className="p-2">Name</th>
                <th className="p-2">Email</th>
                <th className="p-2">Actions</th>
              </tr>
            </thead>
            <tbody>
              {teachers.map((teacher) => (
                <tr key={teacher._id}>
                  <td className="p-2">{teacher.name}</td>
                  <td className="p-2">{teacher.email}</td>
                  <td className="p-2">
                    <button onClick={() => handleDelete(teacher._id)}
                      className="bg-red-500 text-white px-3 py-1 rounded">
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
